#include <iostream>
using namespace std;
int main()
{
    long long a,b;
    cin>>a>>b;
    if(a%2==0)
    {
        if(b%2==0)
        {
            cout<<"Vladik"<<endl;
        }
        else
        {
            cout<<"Valera"<<endl;
        }
    }
    else
    {
        if(b%2==0)
        {
            cout<<"Valera"<<endl;
        }
        else
        {
            cout<<"Vladik"<<endl;
        }
    }
    return 0;
}

